import React, {useEffect, useState} from "react";

const swiperSlide = {
    width: '100px',
    height: '500px',

    img: {
        display: 'block',
        width: '100%',
        height: '100%',
        objectFit: 'cover'
    }
}

function MainCardCarousel(props) {

    // useEffect(() => {
    //     if (document.querySelector(
    //         'script[src="https://cdn.jsdelivr.net/npm/swiper@10/swiper-element-bundle.min.js"]'
